	public static void renameOrDelFile(File doFile,String destPath){
		File newFile = new File(destPath);
		if(newFile.exists()){
			boolean flag = doFile.delete();
			logger.info("del");
			if(!flag){
				logger.info("del failture");
			}
		}else{
			//重命名
			try {
				FileUtils.copyFile(doFile, newFile);
			} catch (IOException e) {
				logger.info("copy failture");
			}
			boolean flag = doFile.delete();
			if(!flag){
				logger.info("copy to del failture");
			}
		}
	}


